column8:
クッション性を強化！熱や日差しからナビを守る。<br>5.8～7インチワイドのポータブルナビゲーションに最適な保護カバー。<br>衝撃からポータブルナビゲーションを保護。<br>背面スリットにより、ポータブルナビゲーションを基台に取り付けたまま脱着でき、そのまま持ち運びも可能。<br>液晶モニターにかぶせてマジックテープで留めるだけの簡単装着。<br>スタイリッシュなハイブリッドレザー。<style type="text/css">
