同乗者を退屈させない！快適ドライブの必需品！<br><br>
装着する車種またはナビの機種により、製品の適合品番が異なります。 <br>
詳しくは最新適合表をご参照ください。<br><br>

※※※画面注視禁止！※※※<br>
運転手が走行中カーナビ/TVの画面を注視することは、道路交通法で禁じられています。(道交法第71条)ただし運転手以外の方が走行中TVを見ることは、法律上問題ありません。<br><br>
切替タイプ<br>
切替スイッチを標準装備。スイッチ操作によりノーマル制御に戻すことができます。<br>
<br>
ご注意<br>
車両によってはTV-KITの動作中（切替スイッチON時）は、ナビゲーション上の自車位置や距離に関する情報（平均時速/燃費等）が不正確になったり、機能の一部が使用できない場合があります。それら機能を使用する際は、TV-KITをOFFにしてください。尚、TV-KITをOFF（切替スイッチOFF）にした時に自車位置が正確な位置に戻るまでの時間は、走行、周囲の状況、GPSの受信状況などにより時間がかかる場合があります。 ※切替スイッチを取り外してのご使用はできません。  <br><br>
オートタイプ<br>
切替スイッチがないため取付けがシンプルで、室内のイメージを損なわず装着できます。<br>
※切替スイッチを追加することはできません。 <br><br>
外形寸法（TV-KIT本体） W75mm×H23.5mm×D64mm<br>
※品番によってケースの形状及びサイズが異なります。 <br>
切替スイッチ W20.5mm×H13.5mm×D35.5mm <br>
重量 38g （本体） <br>
<br>
・TV-KIT本体 ・切替スイッチ（※切替タイプのみ付属） <br>
・両面テープ ・取扱/取付説明書 <br>
・保証書（ユーザー保証登録カード付属）<br>
</font></center>
